INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (192,'036','푸른푸른 바다의 바람만큼 외로운 등대와 같습니다. 그렇다고 부당한 일을 행해 이루려고 이익을 얻으려 하면 해가 있겠습니다. 적막한 천지에 무의무탄 하는 처지니 인간세상에서 그 고독을 누가 가늠하겠습니까. 새로운 뜻을 품어 일을 이루려 노력하면 길하겠습니다. 친구와 선배를 가까이 하십시오. 그러면 길하겠습니다. 그러나 만일 주색을 가까이 하면 반드시 후회가 있겠습니다. 글쓴이의 운수는 성공하기 어려운 운으로 방황하던 객가 달을 찾다 놓치는 것입니다. 겁살이 몸을 친근할 수 있어 장애의 두려움이 있고 처음은 이득이 있을 것 같아 가까이 하지만 도리어 해가 되는 얼어이 있습니다. 특히 북방을 조심하는 게 좋겠습니다. 남의 뒤는 복이 되는 것도 자신이 넘봐 때는 흉이 되어 돌아오기 때문입니다.','신수가 좋지 않아 혹 다른 곳으로 이동하려 해도 얼을 면하기 어렵겠습니다. 친한 사람으로부터 시기를 당하게 되어 하려는 일에도 해가 있겠습니다. 만일 집에 근심이 없으면 부모상을 당하거나 부모의 얼으로 인해 무로움을 당하겠습니다.','의심이 부족하니 맹사에 만족함이 없겠습니다. 이루어 보려는 마음은 있으나 얼이 참어 꾀한 대로 이루기는 어려운 것입니다. 스스로 자탄하며 무로웠든 그런 걸 어찌하겠습니까. 남으로 인해 패할 일이 있으니 함께 일하지 마십시오.','근심이 끊이지 않으니 밤에 잠을 이루지 못하겠습니다. 집에는 자고가 있어 마음이 평안하지 못하겠습니다. 마음을 달래려고 집을 떠나 밖으로 나가려하면 또 다른 재앙이 도사리고 있게될 운입니다. 밖에는 이익 될 일이 없으니 집을 지키며 인내하는 것이 좋겠습니다.','우연히 시작한 일에 재물이 들어옵니다. 물에서 이익을 찾으려 하면 흐뭇함상이고 안집에서 복덕을 구하면 꾀한 대로 이루어지겠습니다. 그러나 바라던 일을 이루어 재물을 모으려 해도 들어온 이익이 모자라는 감이 있겠습니다.','얼어을 넘기고 새로운 사업을 하려하나 집에 다시 근심이 생기기 시작합니다. 성급히 이루려고 큰 것을 탐하다 도리어 해가 따르겠습니다. 적은 것을 바라고 내실을 꾀하는 게 뜻이 됩니다. 재물이 흩어져 구름과 같으므로 뒤늦게 후회한들 무슨 소용이 있겠습니까.','밝은 빛을 찾기가 어려운 운세입니다. 다른 사람을 믿지 마십시오. 서로 시기하여 마음을 상하게 되고 재물로 다투겠습니다. 여인을 가까이 하는 것도 좋지 않습니다. 만일 이를 어기면 장애가 몸을 치겠습니다.','입을 무겁게 하고 사람을 사귀십시오. 경멋되이 행동하면 구설을 면하기 어렵겠습니다. 주색을 가까이 하면 손재가 있으니 늦 것을 잃고 후회하게 됩니다. 남과 사귀는데 있어서는 양보하고 참는 게 좋겠습니다. 손사를 치르거나 시비할 수 있습니다.','사람이 모여 서로 도우며 사는 게 세상살이인데 남들과 불화하며 일을 구하려 하니 되는 일이 없겠습니다 목석을 가까이 하면 해가 있으니 조심하십시오. 재앙으로 인해 소심, 걱정이 떠나지 않을 운입니다. 미리 불전에 다가가 기도하는 게 좋겠습니다.','남과 북쪽에 불리한 운이 있으니 가지 않는 게 좋습니다. 바라던 일을 이루지 못하겠습니다. 단 서쪽에는 재물이 있어 그곳으로 가면 조금은 얻겠습니다. 집안에 흉한 재앙이 발동하겠으니 미리 명산을 찾아가 마음을 정결히 하고 기도하면 면하게 될 것입니다.','마음을 모아 이를 이루려 하나 세상일에 흐지부한 마음만 남겠습니다. 손재가 없으면 집안에 근심이 있으며 배우자에게 재앙이 닥칠 수 있겠습니다. 그러나 앗 것이 다하면 단 것이 오는 법. 갑자기 온 보물이 있어 마치 형통함을 보겠습니다.','흉기가 발동하니 물과 불을 조심하십시오. 남쪽과 북쪽으로 가지 마십시오. 별로 큰 소득을 얻지 못하겠습니다. 자신이 해야할 도리를 지키고 어김없 없이 일하게 되면 조금이나마 이익이 오고 얼어에서 피할 수 있게 될 것입니다.','백설이 쌓인 곳에서 어찌 푸른 잎을 틔울 수 있겠습니까. 마음만으로 일을 꾀하나 이루지 못해 가슴만 앓는 것입니다. 먼 곳으로 가게 되면 후사이 두려우니 가지 않는 게 좋겠습니다. 소망을 이루지 못하고 제자리만 지키려니 마음만 산란한 운수입니다.','2025-03-02 11:55:55.03997+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (405,'036','就像孤独的灯塔和蓝色的风一样。但是，如果您试图从不公平的工作中受益，那将是有害的。谁会权衡人类世界的孤独。如果我们试图以新的遗嘱来实现工作，我们将会很长。请关闭您的朋友和高年级。那我会这样长。但是，如果您接近主要颜色，您会后悔的。作者的运气是错过月球，他在运气中徘徊，很难成功。人们担心残疾，因为它可能熟悉害怕的身体，而一开始，它似乎是有益的。注意北部特别好。在别人身后的祝福是因为他们结束了。','新水不好，因此，即使您尝试搬到另一个地方，也很难避免它。羡慕一个亲密的人也是有害的。如果您不在家里担心，您将渴望父母或父母的耳朵。','缺乏怀疑，因此对盲人不会满意。我渴望实现，但是很难实现。如果您对自己不满意，该怎么办？不要一起工作，因为由于别人而失去了一些东西。','我不担心，所以我晚上无法入睡。家里有睡眠，所以我不能和平。如果您离开家，出去抚慰您的心，另一场灾难将潜伏。外部没有任何好处，因此最好保留您的房屋。','财富偶然发生了。如果您尝试在水中找到利润，它将尽可能好。但是，即使您试图收集想要的财富，也可能缺乏利润。','我尝试从事新业务，并再次担心。我将垂涎这么大的事情。这意味着您想拥有一件小事，并尝试制造坚固的东西。由于财富分散并且像云一样，遗憾的用途是什么？','这是很难找到明亮的光线的财富。不要相信别人。我们将互相羡慕，我们将因财富而伤害我们的心和吵架。接近女人是不好的。如果您打破它，这种疾病将挣扎。','使你的嘴变得沉重，使人成为人。如果您的表现很酷，很难避免构造。如果您接近主要颜色，则具有灵巧性，因此您将失去它并后悔。最好在约会时给予让步和忍受。您可以玩或施肥。','人们聚集在一起是世界的生活，互相帮助，但他们并没有试图与他人找到工作。由于灾难，胆怯和忧虑不会离开。提前与之祈祷是一个好主意。','南部和北部都有缺点，所以不要去。我无法实现我想要的。但是，西方有财富，所以如果您去那里，我会得到一点。房子里会有一场丑陋的灾难，因此，如果您提前去Myeongsan并清洁您的思想并祈祷，您将避免。','我将尝试实现这一目标，但我只会离开世界。没有敏捷，您可能会担心房屋，并且可能是您配偶的灾难。但是，如果是全部，那是一件甜蜜的事情。突然有一个宝藏，所以让我们看看繁荣。','触发武器，因此请注意水和火。不要向南和向北。我不会赚很多收入。如果您保持自己的工作和工作，您将能够获利并避免它。','如何在积雪堆积的地方获得绿叶？我无法用心脏来实现自己的工作，但我只能遭受内心的痛苦。如果您去遥远的地方，您应该害怕胡赛。幸运的是，保持无希望的地方。','2025-03-02 11:55:55.03997+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (476,'036','それは青い海の風と同じくらい孤独な灯台のようなものです。ただし、不公平な仕事から利益を得ようとすると、それは有害です。誰が人間の世界で孤独を比較検討するでしょう。新しい意志で仕事を達成しようとするなら、私たちは長くなります。友達と先輩を閉じてください。それから私はそれを長くします。しかし、メイン色に近づくと、後悔するでしょう。著者の幸運は、成功するのが難しい運をさまよっていた月を見逃すことです。それは怖い体に精通している可能性があるため、障害への恐怖があり、最初はそれは有益であるようです。北に注意するのは特に良いことです。他人の背後にある祝福は、彼らが終わったときに徹底的に戻ってくるからです。','新しい水は良くないので、別の場所に移動しようとしたとしても、それを避けることは困難です。また、親しい人からうらやましいことは有害です。あなたが家で心配していないなら、あなたはあなたの親や親の耳に熱心になります。','疑いがないので、盲人に満足することはありません。私は達成したいと思っていますが、達成することは困難です。あなたが自分自身に不満を抱いていたらどうしますか？他の人のために失うものがあるので、一緒に働かないでください。','心配していないので、夜は眠れません。家で眠っているので、私は平和になれません。あなたが家を出て、あなたの心を落ち着かせるために出かけると、別の災害が潜んでいます。外部から利益を得るものは何もないので、あなたの家を維持する方が良いです。','富は偶然に起こったことに来ます。水中で利益を見つけようとすると、できる限り良いものになります。ただし、あなたが望むものに富を集めようとしたとしても、利益が不足している可能性があります。','私は新しいビジネスをしようとし、再びそれを心配しようとしています。私は達成するために大きなことを切望します。それはあなたが小さなものを持ち、しっかりしたものを作ろうとしたいということを意味します。富が散らばっていて雲のようになっているので、後悔の使用は何ですか？','明るい光を見つけるのが難しい大金です。他の人を信じないでください。私たちはお互いにうらやましくなり、心を傷つけ、富で口論します。女性の近くにいるのは良くありません。あなたがそれを壊すと、障害は苦労します。','口を重くして人を作ってください。あなたが冷静に行動する場合、建設を避けることは困難です。メインの色に近づくと、器用さがあるので、遅れて後悔するでしょう。デートするときは譲歩し、耐える方が良いです。あなたはあなたの手を遊んだり受精させたりすることができます。','人々が互いに助け合うために集まるのは世界の生活ですが、彼らは他の人と仕事を見つけようとしていません。災害のため、ti病と心配は去りません。事前にアプローチして祈ることをお勧めします。','南と北には欠点があるので、行かないでください。私は自分が欲しかったことを達成できません。しかし、西側には富があるので、そこに行くと少し手に入れるでしょう。家にはugい災害が発生するので、事前にミオンサンに行って心をきれいにして祈ると、それを避けます。','私はこれを達成しようとしますが、私は世界を去るだけです。器用さがなければ、あなたは家を心配しているかもしれず、あなたの配偶者の災害かもしれません。しかし、それがすべてなら、それは甘いものです。突然宝物があるので、繁栄を見てみましょう。','武器はトリガーされているので、水と火に注意してください。南と北に行かないでください。私はあまり収入を得ません。自分で仕事をして仕事をしていると、少し利益を得て避けることができます。','雪が積まれている場所に緑の葉をどうやって手に入れることができますか？私は自分の心で仕事を達成することはできませんが、私は自分の心に苦しんでいます。あなたが遠い場所に行くならば、あなたはフッサイを恐れるべきです。希望なしに所定の位置に保つことは幸運なことです。','2025-03-02 11:55:55.03997+00','j');
